import React from 'react';

import logoSide from '../images/logo-side.png';
import logo from '../images/logo-side@2x.png';

// import { Container } from './styles';

export default function Header() {
	return (
		<header id="header">

			<div id="header-wrap">

				<div className="container clearfix">

					<div id="primary-menu-trigger"><i className="icon-reorder"></i></div>

					<div id="logo" className="nobottomborder">
						<a href="/" className="standard-logo" ><img src={logoSide} alt="Canvas Logo"></img></a>
						<a href="/" className="retina-logo" ><img src={logo} alt="Canvas Logo"></img></a>
					</div>

					<nav id="primary-menu">
						<div className="col-lg-12">
							<ul className="list-group" style={{ listStyle: "none" }}>
								<li><a href="#tab-category" className="list-group-item list-group-item-action clearfix">Categorias <i className="icon-user float-right"></i></a></li>
								<li><a href="#tab-sub" className="list-group-item list-group-item-action clearfix">Sub Categorias <i className="icon-laptop2 float-right"></i></a></li>
								<li><a href="#tab-product" className="list-group-item list-group-item-action clearfix">Produtos <i className="icon-envelope2 float-right"></i></a></li>
							</ul>
							<ul className="list-group" style={{ listStyle: "none" }}>
								<li><a href="#" className="list-group-item list-group-item-action clearfix">Logout <i className="icon-line2-logout float-right"></i></a></li>
							</ul>
						</div>
					</nav>

				</div>

				</div>

		</header>

			);
		}
